create table if not exists coach_type
(
    id   binary(16)  not null
    primary key,
    name varchar(50) null,
    slug varchar(50) null,
    constraint UK_fc0wmupoe6ins7bme1axowalc
    unique (slug)
    );

create table if not exists coach
(
    id            binary(16) not null
    primary key,
    coach_type    binary(16) null,
    coach_type_id binary(16) null,
    constraint FK6nlbcfm01b6laj5yfdc3mevd2
    foreign key (coach_type_id) references coach_type (id),
    constraint FKio269ug9c39rmayd4mlfjcnl1
    foreign key (coach_type) references coach_type (id)
    );

create table if not exists departure
(
    id   binary(16)   not null
    primary key,
    name varchar(100) null,
    slug varchar(100) null,
    constraint UK_srma5kyigp8x641vh9l6spbyv
    unique (slug)
    );

create table if not exists destination
(
    id   binary(16)   not null
    primary key,
    name varchar(100) null,
    slug varchar(100) null,
    constraint UK_3rj19p380ns8wvwwxyn0ljnwi
    unique (slug)
    );

create table if not exists departure_destination
(
    departure_id   binary(16) not null,
    destination_id binary(16) not null,
    constraint FK58qjik2i4f7fjo1cd5vuntqrl
    foreign key (destination_id) references departure (id),
    constraint FKftbd7av0vyh6sfe82jo07uuyh
    foreign key (departure_id) references destination (id)
    );

create table if not exists drop_off_type
(
    id   binary(16)   not null
    primary key,
    name varchar(100) null
    );

create table if not exists drop_off
(
    id               binary(16)   not null
    primary key,
    location         varchar(100) null,
    destination_id   binary(16)   null,
    drop_off_type_id binary(16)   null,
    constraint FK5nokhlaqjgtuyd23bvslk6s0g
    foreign key (drop_off_type_id) references drop_off_type (id),
    constraint FKlpx12h6wqrk2w4222ts0nk7rp
    foreign key (destination_id) references destination (id)
    );

create table if not exists line
(
    id             binary(16) not null
    primary key,
    departure_date date       null,
    departure_time time(6)    null,
    price          double     not null,
    status         bit        not null,
    departure_id   binary(16) null,
    destination_id binary(16) null,
    coach_id       binary(16) null,
    constraint FK3qf38rxui7ux5uvlcsss67flc
    foreign key (destination_id) references destination (id),
    constraint FK97e8m55jfwvdihgepkupabwlp
    foreign key (coach_id) references coach (id),
    constraint FKsuqjsau6l1tmm2cruj4i1luh3
    foreign key (departure_id) references departure (id)
    );

create table if not exists pick_up_type
(
    id   binary(16)   not null
    primary key,
    name varchar(100) null
    );

create table if not exists pick_up
(
    id              binary(16)   not null
    primary key,
    location        varchar(100) null,
    departure_id    binary(16)   null,
    pick_up_type_id binary(16)   null,
    constraint FK8t74owd752763tjwxyqw3remf
    foreign key (pick_up_type_id) references pick_up_type (id),
    constraint FKmlia9tmsqwjvhn5ovu2jmc3ll
    foreign key (departure_id) references departure (id)
    );

create table if not exists seat
(
    id       binary(16)  not null
    primary key,
    decker   int         not null,
    is_blank bit         not null,
    position varchar(10) null,
    coach_id binary(16)  null,
    constraint FK6kj69hqxssst115ysgttqhpgu
    foreign key (coach_id) references coach (id)
    );

create table if not exists ticket
(
    id            binary(16)   not null
    primary key,
    cost          double       not null,
    is_oneway     bit          not null,
    is_paid       bit          not null,
    note          varchar(255) null,
    number        int          not null,
    street_number varchar(100) null,
    drop_off_id   binary(16)   null,
    line_id       binary(16)   null,
    pick_up_id    binary(16)   null,
    constraint FK4n741jclw9uwndth34ivl55rb
    foreign key (pick_up_id) references pick_up (id),
    constraint FK5tuf7c5tg0mclb8oc2oo7ufi4
    foreign key (drop_off_id) references drop_off (id),
    constraint FKd7o8kb4a3pg1eg5bkgmw4hycs
    foreign key (line_id) references line (id)
    );

create table if not exists line_seat
(
    line_id      binary(16) not null,
    seat_id      binary(16) not null,
    is_available bit        not null,
    ticket_id    binary(16) null,
    primary key (line_id, seat_id),
    constraint FK30maxlnvcohk1w8x09ayx7vt7
    foreign key (seat_id) references seat (id),
    constraint FK74b5pmbf588aiga9ps70057o0
    foreign key (ticket_id) references ticket (id),
    constraint FKdh2comworj3wiiijr9044httq
    foreign key (line_id) references line (id)
    );

create table if not exists passenger
(
    id            binary(16)   not null
    primary key,
    email         varchar(50)  null,
    is_booking    bit          not null,
    name          varchar(100) null,
    phone         varchar(15)  null,
    year_of_birth int          not null,
    ticket_id     binary(16)   null,
    constraint FKpg5id0f2y9epw84q2wq6kbvje
    foreign key (ticket_id) references ticket (id)
    );

create table if not exists ticket_drop_off
(
    drop_off_id binary(16) not null,
    ticket_id   binary(16) not null,
    constraint FK8ymtirbtdlrf7v9l5hnad5eu
    foreign key (drop_off_id) references ticket (id),
    constraint FKme82q5wq3l1f927gqi9nhpx07
    foreign key (ticket_id) references drop_off (id)
    );

create table if not exists ticket_line
(
    line_id   binary(16) not null,
    ticket_id binary(16) not null,
    constraint FKj3a1vlggcw2ak3u2rtg6rn39i
    foreign key (ticket_id) references line (id),
    constraint FKliigxja4qcjnjtocl7j5m2f1e
    foreign key (line_id) references ticket (id)
    );

create table if not exists ticket_pick_up
(
    pick_up_id binary(16) not null,
    ticket_id  binary(16) not null,
    constraint FK93xmeqxk1ev237i10hur6tn6i
    foreign key (pick_up_id) references ticket (id),
    constraint FKr15y3jqqvdk9845ttevayafi9
    foreign key (ticket_id) references pick_up (id)
    );

